import React, { useState } from 'react';

import './Employee.css';

import Logo from '../assets/users.jpg';

import { Avatar } from '@material-ui/core';
import CommentOutlinedIcon from '@material-ui/icons/CommentOutlined';
import Message from './Message';

const Employee = () => {

    const slobodan = "Odsutan";
    const [comment, setComment] = useState(false);

    return (
        <div className="employee">
            <Avatar src={Logo}  />
            <span>Adam Horvat</span>
            <span>Infostud 3</span>
            <span>Subotica</span>
            <span>Polovni automobili</span>
            <span>Frontend Developer</span>
            <span>24.05.2021.</span>
            <span>Rad od kuce</span>
            {slobodan==="Odsutan" ? 
                <CommentOutlinedIcon 
                    onMouseEnter={() => setComment(true)} 
                    onMouseLeave={() => setComment(false)} /> : 
                    ""
                }
            {comment && <Message />}
        </div>
    )
}

export default Employee
